User validation failed: password: Path `password` is required<p>I'm trying to register users and then authenticate them using passport-local-mongoose. When I try to register a user I get the error 'User validation failed: password: Path <code>password</code> is required.' I got rid of the error by changing <code>required</code> to <code>false</code> for <code>password</code> field of my userSchema in 'userModel.js' but I assume that password has to be required. Does anyone know of a better solution?
And moreover I don't understand why it's giving me the error when I've included a password field for the user.</p>
<p>And when I do change <code>required</code> to <code>false</code> for <code>password</code>, the registration works and I end up with the user stored in the Users collection, but then the authentication gives me a Status 400 Bad Request error and over there I'm completely stuck.</p>
<p>This is my server.js</p>
