How to encrypt a Class property using Mongodb CSFLE in dot net core<p>I am trying to use Mongodb Client side field level encryption (CSFLE) with Dot net core (v5.0).</p>
<p>I have it working using the Json Schema map as per docs, which uses BSONDocument types and I can define each field to encrypt (have followed this guide <a href="https://www.mongodb.com/developer/how-to/client-side-field-level-encryption-mongodb-csharp/" rel="nofollow noreferrer">https://www.mongodb.com/developer/how-to/client-side-field-level-encryption-mongodb-csharp/</a>)</p>
<p>I now need to apply this to individual properties on my C# Class models.
Can I use an annotation or somehow tell MongoDb Driver to serialize my class property to the binary type required in the BsonDocument schema?</p>
<p>This works:</p>
<pre><code>  var schemaMap = $@&quot;{{
                properties: {{
                    SSN: {{
                        encrypt: {{
                            keyId: [{{
                                '$binary' : {{
                                    'base64' : '{base64DataKeyId}',
                                    'subType' : '04'
                                }}
                            }}],
                        bsonType: 'string',
                        algorithm: 'AEAD_AES_256_CBC_HMAC_SHA_512-Deterministic'
                        }}
                    }}
                }},
                'bsonType': 'object'
            }}&quot;;

 var autoEncryptionSettings = new AutoEncryptionOptions(
                keyVaultNamespace,
                kmsProviders,
                schemaMap: new Dictionary&lt;string, BsonDocument&gt;()
                {
                    { collectionNamespace.ToString(), BsonDocument.Parse(schemaMap) }
                });
</code></pre>
<p>I need to somehow apply this to a C# class model like this:</p>
<pre><code> public class TestModel
        {
            [MongoEncrypted?]
            public string SSN { get; set; }
        }
</code></pre>
<p>I use a basic repository pattern, and currently pass my Class models in to the Mongo driver like this</p>
<pre><code> _mongoCollection = _mongoContext.GetCollection&lt;TEntity&gt;(collectionName);
</code></pre>
<p>How do I tell the Mongodb Driver to apply the Json Schema to my existing class properties?
Is this possible?</p>
<p>Thank you.</p>

